import axios from "axios"
import {API_URL} from "@utils/url/Constants.js" 

export const getAxiosInstance = () => {

     const instance = axios.create({
        baseURL: `${API_URL}`,
        timeout: 10000,
        params: {} 
    });



    return instance;

}
